    } else if (t == 2) {
      /* delete */
      int x;
      scanf("%d", &x);
      veb.erase(x);
    } else if (t == 3) {
      /* dump */
      unsigned long long l, r;
      scanf("%llu %llu", &l, &r);
      if (veb.max() < l) continue;

      if (veb.contains(l))
