//van Emde Boas trees 
class VEBtree;

class VEBtreeNode{
	using Number = unsigned long long;
	friend VEBtree;
	const Number K;
	const Number uppersqrt = (1 << ((K+1) >> 1));
	const Number lowersqrt = (1 << (K >> 1));
	Number min_ = 1, max_ = 0;
	std::vector<VEBtreeNode> cluster;
	VEBtreeNode *summary;

	Number high(Number x){ return x/lowersqrt ;}
	Number low(Number x){ return x % lowersqrt;}
	Number index(Number x, Number y){ return x*lowersqrt + y;}

	void empty_insert(Number x){
		min_ = x;
		max_ = x;
	}
	Number min(){ return min_;}
	Number max(){ return max_;}

	bool member(Number x){
		if(min() > max())return false;
		if(x == min() || x == max())return true;
		else if(K == 1)return false;
		assert(high(x) < cluster.size());
		return cluster[high(x)].member(low(x));
	}

	Number successor(Number x){
		if(K == 1){
			if(x == 0 and max() == 1) return 1;
			else return x;
		}
		else if(min() <= max() and x < min()) return min();
		else{
			Number max_low = cluster[high(x)].max();
			if(cluster[high(x)].min() <= max_low and low(x) < max_low){
				Number offset = cluster[high(x)].successor(low(x));
				return index(high(x), offset);
			}
			Number succ_cluster = summary->successor(high(x));
			if(succ_cluster == high(x)) return x;
			else{
				Number offset = cluster[succ_cluster].min();
				return index(succ_cluster, offset);
			}
		}
	}

	Number predecessor(Number x){
		if(K == 1){
			if(x == 1 and min() == 0) return 0;
			else return x;
		}
		else if(min() <= max() and x > max()){ return max();}
		else{
			Number min_low = cluster[high(x)].min();
			if(min_low <= cluster[high(x)].max() and low(x) > min_low){
				Number offset = cluster[high(x)].predecessor(low(x));
				return index(high(x), offset);
			}
			Number pred_cluster = summary->predecessor(high(x));
			if(pred_cluster == high(x)){ return x;}
			else{
				Number offset = cluster[pred_cluster].max();
				return index(pred_cluster, offset);
			}
		}
	}

	void insert(Number x){
		if(min() > max()) empty_insert(x);
		else{
			if(x < min()) std::swap(x, min_);
			if(K > 1){
				if(cluster[high(x)].min() > cluster[high(x)].max()){
					summary->insert(high(x));
					cluster[high(x)].empty_insert(low(x));
				}
				else{
					cluster[high(x)].insert(low(x));
				}
			}
			if(x > max()){
				max_ = x;
			}
		}
	}

	void erase(Number x){
		if(min() == max()){
			min_ = 1; max_ = 0;
		}
		else if(K == 1){
			if( x == 0) min_ = 1;
			else min_ = 0;
			max_ = min_;
		}
		else{
			if(x == min()){
				Number first_cluster = summary->min();
				x = index(first_cluster, cluster[first_cluster].min());
				min_ = x;
			}
			cluster[high(x)].erase(low(x));
			if(cluster[high(x)].min() > cluster[high(x)].max()){
				summary->erase(high(x));
				if(x == max()){
					Number summary_max = summary->max();
					if(summary_max < summary->min()) max_ = min();
					else max_ = index(summary_max, cluster[summary_max].max());
				}
			}
			else if(x == max()){
				max_ = index(high(x), cluster[high(x)].max());
			}
		}
	}

	public:
		VEBtreeNode(const VEBtreeNode& m):K(m.getK()){
			if(K != 1){
				summary = new VEBtreeNode((K+1)>>1);
				cluster = std::vector<VEBtreeNode>(uppersqrt, VEBtreeNode(K>>1));
			}
			else{
				summary = NULL;
			}
		}

		VEBtreeNode(Number k): K(k){
			if(K != 1){
				summary = new VEBtreeNode((K+1) >> 1);
				cluster = std::vector<VEBtreeNode>(uppersqrt, VEBtreeNode(K>>1));
			}
			else{
				summary = NULL;
			}
		}

		~VEBtreeNode() = default;

		Number getK()const{return K;}
};

class VEBtree{
	using Number = unsigned long long;
	VEBtreeNode *root;
	size_t size_;
public:
	VEBtree(): root(new VEBtreeNode(24)), size_(0){}
	VEBtree(Number universe): size_(0){
		Number K = 0;
		for(universe--;universe;universe >>= 1)K++;
		root = new VEBtreeNode(K ? K : 1);
	}
	~VEBtree(){ delete root;}

	size_t size()const{return size_;}
	Number min(){ return root->min();}
	Number max(){ return root->max();}
	bool member(Number e){ return root->member(e);}
	Number successor(Number e){
		return root->successor(e);
	}
	Number predecessor(Number e){
		return root->predecessor(e);

	}
	void insert(Number e){
		if(!root->member(e)){
			root->insert(e);
			size_++;
		}
	}
	void erase(Number e){
		if(root->member(e)){
			root->erase(e);
			size_--;
		}
	}


};

