//van Emde Boas trees 
class VEBtree;

class VEBtreeNode{
	using Number = unsigned long long;
	friend VEBtree;
	const Number K; //universe = 2 ^ K
	const Number uppersqrt = (1 << ((K+1)/2)); //sqrt(ceil(universe/2))
	const Number lowersqrt = (1 << (K/2));//sqrt(floor(universe/2))
	Number min_, max_;
	std::map<Number, VEBtreeNode> cluster;
	VEBtreeNode *summary = nullptr;

	Number high(Number x){ return x/lowersqrt ;}
	Number low(Number x){ return x % lowersqrt;}
	Number index(Number x, Number y){ return x*lowersqrt + y;}

	Number min()const{ return min_;}
	Number max()const{ return max_;}

	bool empty()const{ return max() < min();}

	bool member(Number x){
		if(empty())return false;
		if(x == min() || x == max()) return true;
		else if(K == 1) return false;
		if(summary == nullptr || !summary->member(high(x))) return false;
		return cluster.at(high(x)).member(low(x));
	}

	Number successor(Number x){
		if(empty()) return x;
		if(K == 1){
			if(x == 0 && max() == 1) return 1;
			else return x;
		}
		if(x < min()) return min();
		if(summary == nullptr) return max();
		if(summary->member(high(x)) && low(x) < cluster.at(high(x)).max()){
			Number offset = cluster.at(high(x)).successor(low(x));
			return index(high(x), offset);
		}
		Number succ_cluster = summary->successor(high(x));
		if(succ_cluster == high(x)) return x;
		else{
			Number offset = cluster.at(succ_cluster).min();
			return index(succ_cluster, offset);
		}
	}

	Number predecessor(Number x){
		if(empty()) return x;
		if(K == 1){
			if(x == 1 && min() == 0) return 0;
			else return x;
		}
		if(max() < x) return max();
		if(summary == nullptr) return min();
		if(summary->member(high(x)) && cluster.at(high(x)).min() < low(x)){
			Number offset = cluster.at(high(x)).predecessor(low(x));
			return index(high(x), offset);
		}
		Number pred_cluster = summary->predecessor(high(x));
		if(pred_cluster == high(x)){ return x;}
		else{
			Number offset = cluster.at(pred_cluster).max();
			return index(pred_cluster, offset);
		}
	}

	void empty_insert(Number x){
		min_ = x; max_ = x;
	}

	void insert(Number x){
		if(empty()) empty_insert(x);
		else{
			if(x < min()) std::swap(x, min_);
			if(K > 1){
				if(summary == nullptr){
					summary = new VEBtreeNode((K+1)/2, high(x));
					cluster.insert({high(x), VEBtreeNode(K/2, low(x))});
				}
				else if(!summary->member(high(x))){
					summary->insert(high(x));
					cluster.insert({high(x), VEBtreeNode(K/2, low(x))});
				}
				else cluster.at(high(x)).insert(low(x));
			}
			if(x > max()){
				max_ = x;
			}
		}
	}

	void erase(Number x){
		assert(!empty());
		if(min() == max()){
			min_ = 1; max_ = 0;
		}
		else if(K == 1){
				if(x == 0) min_ = 1;
				else min_ = 0;
				max_ = min_;
		}
		else{
			if(x == min()){
				Number first_cluster = summary->min();
				x = index(first_cluster, cluster.at(first_cluster).min());
				min_ = x;
			}
			cluster.at(high(x)).erase(low(x));
			if(cluster.at(high(x)).empty()){
				summary->erase(high(x));
				cluster.erase(high(x));
				if(x == max()){
					if(summary->empty()){
						max_ = min();
						delete summary;
						summary = nullptr;
					}
					else max_ = index(summary->max(), cluster.at(summary->max()).max());
				}
			}
			else if(x == max()) max_ = index(high(x), cluster.at(high(x)).max());
		}
	}

	public:
	VEBtreeNode(Number k, Number x): K(k), min_(x), max_(x){}
	~VEBtreeNode(){
		delete summary;
	}
	Number getK()const{return K;}
};

class VEBtree{
	using Number = unsigned long long;
	const Number K;
	VEBtreeNode *root;
	size_t size_;
	public:
	VEBtree(): K(24), root(nullptr), size_(0){}
	VEBtree(Number universe): K(sizeof(Number)*8 - __builtin_clzll(universe)), root(nullptr), size_(0){}
	~VEBtree(){ delete root;}

	size_t size()const{return size_;}
	Number min(){ return root->min();}
	Number max(){ return root->max();}
	bool member(Number e){
		if(size() == 0) return false;
		return root->member(e);
	}
	Number successor(Number e){
		if(size() == 0) return e;
		return root->successor(e);
	}
	Number predecessor(Number e){
		if(size() == 0) return e;
		return root->predecessor(e);

	}
	void insert(Number e){
		if(size() == 0){
			root = new VEBtreeNode(K, e);
			size_++;
		}
		else if(!member(e)){
			root->insert(e);
			size_++;
		}
	}
	void erase(Number e){
		if(member(e)){
			root->erase(e);
			size_--;
		}
	}
};
