inline unsigned int in() {
    unsigned int n = 0; unsigned short c;
    while ((c = getchar()) >= '0') n = n * 10 + c - '0';
    return n;
}

inline void out(unsigned int n) {
    static unsigned short res[10], i = 0;
    do { res[i++] = n % 10, n /= 10; } while (n);
    while (i) putchar(res[--i] + '0');
    putchar('\n');
}

int main()
{
    vanEmdeBoasTree veb;
    unsigned int n = in(), a, b, st;
    rep(i,n){
        a = in();
        if(a == 0){
            veb.insert(in());
            out(veb.size());
        }else if(a == 1){
            out(veb.find(in()));
        }else if(a == 2){
            a = in();
            if(veb.find(a)) veb.erase(a);
        }else{
            a = in(), b = in();
            for(st = veb.successor(a-1); st <= b; st = veb.successor(st))
                out(st);
        }
    }
    return 0;
}

