template<typename elem_t>
struct node_t
{
   using count_t = unsigned int;
   using pri_t = double;

   elem_t elem;
   node_t *lch, *rch, *par;
   count_t cnt;
   pri_t pri;

   node_t(elem_t elem) : elem(elem), lch(nullptr), rch(nullptr),
                         par(nullptr), cnt(1), pri((pri_t)dist(mt)) {}

   static count_t count(node_t* node) {
      // cout << "node_t::count is called" << endl;
      if (node != nullptr) {
         return node->cnt;
      } else {
         return 0;
      }
   }

   static node_t* update(node_t* node) {
      // cout << "node_t::update is called" << endl;
      assert(node != nullptr);
      node->cnt = count(node->lch) + count(node->rch) + 1;

      node->par = nullptr;
      if (node->lch != nullptr) {
         node->lch->par = node;
      }
      if (node->rch != nullptr) {
         node->rch->par = node;
      }

      return node;
   }

   static node_t* merge(node_t* l, node_t* r) {
      // cout << "node_t::merge is called" << endl;
      if (l == nullptr) {
         return r;
      } else if (r == nullptr) {
         return l;
      }

      // update(l);
      // update(r);

      assert(l->pri != r->pri);

      if (r->pri < l->pri) {
         l->rch = merge(l->rch, r);
         return update(l);
      } else {
         r->lch = merge(l, r->lch);
         return update(r);
      }
   }

   // TODO elemconst &
   //
   static pair<node_t*, node_t*> split(node_t* node, elem_t elem, bool includeToRight) {
      // cout << "node_t::split is called" << endl;
      if (node == nullptr) {
         return { nullptr, nullptr };
      }
      // update(node);

      node_t *l, *r;
      if (includeToRight) {
         if (node->elem < elem) {
            tie(l, r) = split(node->rch, elem, includeToRight);
            node->rch = l;
            return { update(node), r };
         } else {
            tie(l, r) = split(node->lch, elem, includeToRight);
            node->lch = r;
            return { l, update(node) };
         }
      } else {
         if (node->elem <= elem) {
            tie(l, r) = split(node->rch, elem, includeToRight);
            node->rch = l;
            return { update(node), r };
         } else {
            tie(l, r) = split(node->lch, elem, includeToRight);
            node->lch = r;
            return { l, update(node) };
         }
      }
   }

   static node_t* insert(node_t* node, elem_t elem) {
      // cout << "nodt_t::insert is called" << endl;
      node_t *l, *c, *r;
      tie(c, r) = split(node, elem, false);
      tie(l, ignore) = split(c, elem, true);
      auto p_node = new node_t(elem);
      return merge(l, merge(p_node, r));
   }

   static pair<node_t*, node_t*> erase(node_t* node, elem_t elem) {
      // cout << "node_t::erase is called" << endl;
      node_t *l, *c, *r;
      tie(c, r) = split(node, elem, false);
      tie(l, ignore) = split(c, elem, true);
      return { merge(l, r), c };
   }

   static node_t* find(node_t* node, elem_t elem) {
      // cout << "node_t::find is called" << endl;
      if (node == nullptr) {
         return nullptr;
      }
      if (node->elem < elem) {
         return find(node->rch, elem);
      } else if (elem < node->elem) {
         return find(node->lch, elem);
      } else {
         return node;
      }
   }

   static node_t* at(node_t* node, count_t k) {
      assert(node != nullptr);
      assert(node->cnt > k);

      if (count(node->lch) == k) {
         return node;
      } else if (count(node->lch) > k) {
         return at(node->lch, k);
      } else {
         return at(node->rch, k-1-count(node->lch));
      }
   }

   static node_t* lower_bound(node_t* node, elem_t elem) {
      // cout << "node_t::lower_bound is called" << endl;
      if (node == nullptr) {
         return nullptr;
      }
      if (elem <= node->elem) {
         node_t* lb = lower_bound(node->lch, elem);
         if (lb != nullptr) {
            return lb;
         } else {
            return node;
         }
      } else {
         return lower_bound(node->rch, elem);
      }
   }

   node_t* next() {
      if (this->rch != nullptr) {
         node_t* t = this->rch;
         while (t->lch != nullptr) {
            t = t->lch;
         }
         return t;
      }
      node_t* t = this;
      while (t->par != nullptr && t->par->rch == t) {
         t = t->par;
      }
      return t->par;
   }

   static void show(node_t* node) {
      // cout << "node_t::show is called" << endl;
      if (node == nullptr) {
         return;
      }
      show(node->lch);
      cout << "node_t::show " << node
         << ", lch: " << node->lch
         << ", rch: " << node->rch
         << ", elem: " << node->elem
         << ", cnt: " << node->cnt
         << ", pri: " << node->pri << endl;
      show(node->rch);
   }
};



template<typename elem_t>
struct Treap
{
   using count_t = unsigned int;
   using pri_t = double;

   using node = node_t<elem_t>;
   node* root;

   Treap() : root(nullptr) {}

   count_t size() {
      return node::count(root);
   }

   void insert(elem_t elem) {
      root = node::insert(root, elem);
   }

   void erase(elem_t elem) {
      tie(root, ignore) = node::erase(root, elem);
   }

   node* find(elem_t elem) {
      return node::find(root, elem);
   }

   node* lower_bound(elem_t elem) {
      return node::lower_bound(root, elem);
   }

   node* at(count_t k) {
      return node::at(root, k);
   }

   node* begin() {
      return root;
   }

   void show() {
      node::show(root);
   }
};

