{
	DATA_T *p;
	ll_int start_h, end_h;
	ll_int i;


	start_h = Hash(l);
	end_h = Hash(r);

	for(i = start_h; i <= end_h; i++){
		for(p = S[i]; p != NULL; p = p->next){
			if(r < p->num)
				return;

			if(l <= p->num && p->num <= r)
				printf("%lld\n", p->num);
		}
	}
}


