    }
    static void getAns(int q)
    {
        var sb = new StringBuilder();
        var ms = new Set<int>();
        for (int i = 0; i < q; i++)
        {
            string[] line = Console.ReadLine().Trim().Split(' ');
            if (line[0] == "0")
            {
                var x = int.Parse(line[1]);
                ms.Insert(x);
                sb.Append(ms.Count().ToString() + "\n");
            }
            else if (line[0] == "1")
            {
                var x = int.Parse(line[1]);
                if (ms.Contains(x)) sb.Append("1\n");
                else sb.Append("0\n");
            }
            else if (line[0] == "2")
            {
                var x = int.Parse(line[1]);
                ms.Remove(x);
            }
            else
            {
                var L = int.Parse(line[1]);
                var r = int.Parse(line[2]);
                var s = ms.LowerBound(L);
                var e = ms.UpperBound(r) - 1;
                for (int j = s; j <= e; j++) sb.Append(ms.ElementAt(j).ToString() + "\n");
            }
        }
        Console.Write(sb);
    }
}

