const MAX int = 1000000001
const CAP int = 512

func GetLank(i int) int {
	return int(math.Floor(float64(i) / float64(CAP)))
}
func GetIndex(i int) int {
	return i % CAP
}

type MySet struct {
	dataList []map[int]struct{}
	count    []int
	total    int
}

func NewSet() MySet {
	n := (MAX / CAP) + 1
	dataList := make([]map[int]struct{}, n)
	for i := range dataList {
		dataList[i] = make(map[int]struct{})
	}
	counts := make([]int, n)
	return MySet{dataList, counts, 0}
}

func (this *MySet) Exists(i int) bool {
	_, ok := this.dataList[GetLank(i)][GetIndex(i)]
	return ok
}

func (this *MySet) Count() int {
	return this.total
}
func (this *MySet) Add(i int) int {
	lank := GetLank(i)
	if this.Exists(i) {
		return this.Count()
	}
	this.dataList[GetLank(i)][GetIndex(i)] = struct{}{}
	this.count[lank]++
	this.total++
	return this.Count()
}

func (this *MySet) Remove(i int) {
	if this.Exists(i) {
		delete(this.dataList[GetLank(i)], GetIndex(i))
		this.count[GetLank(i)]--
		this.total--
	}
}

func (this *MySet) Find(i int) int {
	if this.Exists(i) {
		return 1
	} else {
		return 0
	}
}

func (this *MySet) Dump(left, right int) []int {
	found := 0 // found in current lank
	count := 0 // num total
	result := make([]int, 8)
	// result := make([]int, this.count)
	for i := left; i <= right; i++ {
		// boundary
		if i % CAP == 0 {
			found = 0
		}
		// not exists in current lank
		lank := GetLank(i)
		if this.count[lank] == 0 {
			i = (lank + 1) * CAP - 1
			found = 0
			continue
		}
		if this.Exists(i) {
			found++
			if len(result) <= count {
				result = append(result, i)
			} else {
				result[count] = i
			}
			// done in current lank
			if found == this.count[lank] {
				i = (lank + 1) * CAP - 1
			}
			count++
		}
	}
	_ = sort.Slice
	result = result[:count]
	sort.Slice(result, func(lhs, rhs int) bool {
		return result[lhs] < result[rhs]
	})
	return result
}

func main() {
	con := NewConsole()
