			con.Printf("%d\n", l)
		case 1: //find
			con.Printf("%d\n", set.Find(x))
		case 2: // delete
			set.Remove(x)
		case 3: // dump
			l, _ := strconv.Atoi(args[1])
			r, _ := strconv.Atoi(args[2])
			result := set.Dump(l, r)
			for i := range result {
				con.Printf("%d\n", result[i])
			}
		}

	}
}

