func solve(scanner *bufio.Scanner, writer *bufio.Writer) {
	q := getNextInt(scanner)
	qq := make([]query, q)
	aa := make([]int, 0)
	for i := 0; i < q; i++ {
		qq[i].t = getNextInt(scanner)
		qq[i].arg1 = getNextInt(scanner)
		aa = append(aa, qq[i].arg1)
		if qq[i].t != 3 {
			continue
		}
		qq[i].arg2 = getNextInt(scanner)
		aa = append(aa, qq[i].arg2)
	}
	c := newCompress(aa)
	r := map[int]int{}
	for v, i := range c {
		r[i] = v
	}
	seg := newSegment(len(c) + 1)
	for i := 0; i < q; i++ {
		switch qq[i].t {
		case 0:
			seg.update(c.get(qq[i].arg1), 1, seg.add)
			fmt.Fprintln(writer, seg[len(seg)-1][0])
		case 1:
			fmt.Fprintln(writer, seg[0][c.get(qq[i].arg1)])
		case 2:
			seg.update(c.get(qq[i].arg1), 0, seg.add)
		case 3:
			ans := make([]int, 0)
			for j := seg.left(0, c.get(qq[i].arg2), 1); j >= c.get(qq[i].arg1); j = seg.left(0, j-1, 1) {
				ans = append(ans, r[j])
			}
			for j := len(ans) - 1; j >= 0; j-- {
				fmt.Fprintln(writer, ans[j])
			}
		}
	}
}

