            else:
                return _find_max(node.right)

        def _find_min(node):
            if node.left is None:
                return node
            else:
                return _find_min(node.left)

        def _remove_max(node):
            if node.right is None:
                return node.left
            else:
                node.right = _remove_max(node.right)
                node.count = self._size(node.right) + self._size(node.left) + 1
                return node

        def _remove_min(node):
            if node.left is None:
                return node.right
            else:
                node.left = _remove_min(node.left)
                node.count = self._size(node.right) + self._size(node.left) + 1
                return node

        self.root = _delete(self.root)

