class BinarySearchTree:
    class Node:
        __slots__ = ('key', 'left', 'right', 'count')

        def __init__(self, key):
            self.key = key
            self.left = None
            self.right = None
            self.count = 0

        def __str__(self):
            return "{}, {} ({}, {})".format(self.key, self.count,
                                            self.left, self.right)

    def __init__(self):
        self.root = None

    def put(self, key):
        def _put(node):
            if node is None:
                node = self.Node(key)
            if node.key > key:
                node.left = _put(node.left)
            elif node.key < key:
                node.right = _put(node.right)
            node.count = self._size(node.left) + self._size(node.right) + 1
            return node

        self.root = _put(self.root)

    def __contains__(self, key):
        def _contains(node):
            if node is None:
                return False
            if node.key > key:
                return _contains(node.left)
            elif node.key < key:
                return _contains(node.right)
            else:
                return True
        return _contains(self.root)

    def delete(self, key):
        def _delete(node):
            if node is None:
                return None

            if node.key > key:
                node.left = _delete(node.left)
            elif node.key < key:
                node.right = _delete(node.right)
            else:
                node = _remove(node)

            if node is not None:
                node.count = self._size(node.right) + self._size(node.left) + 1
            return node

        def _remove(node):
            if node.left is None:
                right, node.right = node.right, None
                return right
            elif node.right is None:
                left, node.left = node.left, None
                return left
            else:
                if self._size(node.right) > self._size(node.left):
                    x = _find_min(node.right)
                    x.right = _remove_min(node.right)
                    x.left = node.left
                else:
                    x = _find_max(node.left)
                    x.left = _remove_max(node.left)
                    x.right = node.right
                return x

        def _find_max(node):
            if node.right is None:
                return node
            else:
                return _find_max(node.right)

        def _find_min(node):
            if node.left is None:
                return node
            else:
                return _find_min(node.left)

        def _remove_max(node):
            if node.right is None:
                return node.left
            else:
                node.right = _remove_max(node.right)
                node.count = self._size(node.right) + self._size(node.left) + 1
                return node

        def _remove_min(node):
            if node.left is None:
                return node.right
            else:
                node.left = _remove_min(node.left)
                node.count = self._size(node.right) + self._size(node.left) + 1
                return node

        self.root = _delete(self.root)

    @property
    def size(self):
        return self._size(self.root)

    def _size(self, node):
        if node is None:
            return 0
        else:
            return node.count

    def range(self, min_, max_):
        def _range(node):
            if node is None:
                return

            if node.key > max_:
                yield from _range(node.left)
            elif node.key < min_:
                yield from _range(node.right)
            else:
                yield from _range(node.left)
                yield node.key
                yield from _range(node.right)

        if min_ > max_:
            return
        yield from _range(self.root)

class BstSet:
    def __init__(self):
        self.bst = BinarySearchTree()

    def add(self, key):
        self.bst.put(key)

    def __contains__(self, key):
        return key in self.bst

    def delete(self, key):
        self.bst.delete(key)

    def range(self, a, b):
        for k in self.bst.range(a, b):
            yield k

    @property
    def count(self):
        return self.bst.size

    def __str__(self):
        return str(self.bst.root)

